import React from 'react';

export default class DictionaryAPI extends React.Component{
    state = {
        loading : true,
        people : []
    }
    async componentDidMount(){
        // best place to make requests
        const url = "https://od-api.oxforddictionaries.com/api/v2/entries/en-us/";
        const response = await fetch(url);
        const data = await response.json();
        this.setState({
            people : data.results,
            loading : false
        });
        console.log(data);
    }
    render(){
        return (
            <div>
                {JSON.stringify(this.state.people)}
            </div>
        );
    }
}
